import React from "react";
import stickersData from "./AuctionStikers-data";
import './AuctionCss/Time.css'

function Time(props){
  const index = props.index;
  const stickersDataIndex = stickersData[index];
  const time = stickersDataIndex.time.split(':');
  return(
    <div className="time">
      <span className="time-text">Окончание через:</span>
      <div className="time-body">
        <div className="tyme-body-el">
          <span>{time[0]}</span>
          <span>Час</span>
        </div>
        <div className="tyme-body-el">
          <span>{time[1]}</span>
          <span>Мин</span>
        </div>
        <div className="tyme-body-el">
          <span>{time[2]}</span>
          <span>Сек</span>
        </div>
      </div>
      <img src="../images/auctions/clock.svg" alt="clock" />
    </div>

  )
}

export default Time
